description:
World Snooker Championship is the most complete snooker game on your mobile, pitting you against the best names in the world of Snooker, Ronnie O'Sullivan, Stephen Hendry, Ding Junhui and more! 

Featuring real ball physics, clinical AI, accurately rendered table and tournament arena, pick-up-and-play controls, Tournament, Quick Game, Fastest Break and Multiplayer game modes... You will agree, this is the best snooker game that money can buy.

